import React from "react";

const Header = () => {
    return (
        <header className="header">
            <img className="logo" src="/nuotraukos/logo.png" alt="Paveikslėlis" />

            <div class="hamburger-menu">
    <span></span>
    <span></span>
    <span></span>
  </div>
               
            
            <h1>Sveiki atvykę į mano pasaulį!</h1>
            <p>Esu grafinės dizainerė ir iliustratorė.</p>
        </header>
    );
};

export default Header;
